import React from "react";
class Demo extends React.Component {
    constructor(props) {
      super(props);
      this.state = {};
    }
  
    handleChange = e => {
      const { name, value } = e.target;
  
      this.setState({
        [name]: value
      });
    };
  
    render() {
      return (
        <div className="radio-buttons">
          Windows
          <input
            id="windows"
            value="windows"
            name="platform"
            type="radio"
            onChange={this.handleChange}
          />
          Mac
          <input
            id="mac"
            value="mac"
            name="platform"
            type="radio"
            onChange={this.handleChange}
          />
          Linux
          <input
            id="linux"
            value="linux"
            name="platform"
            type="radio"
            onChange={this.handleChange}
          />
        </div>
      );
    }
  }

  export default Demo;
